    true,nt"url": null,nt"notes": "<p>The Population online databases  contain
    data from the US Census Bureau.  The Census Estimates online database contains contains
    county-level population counts for years 1970 - 2000.  The data comprise the April
    1st Census counts for years 1970, 1980, 1990 and 2000, the July 1st intercensal
    estimates for years 1971-1979 and 1981-1989, and the July 1st postcensal estimates
    for years 1991-1999.  The Census Projections online database contains population
    projections for years 2004-2030 by year, state, age, race and sex,  prodyced by
    teh Cenus Bureau in 2005. The data are produced by the United States Department
    of Commerce, U.S. Census Bureau, Population Division.</p>n",nt"owner_org":
